import React from 'react'
import "./Form.css"
export const Form = (props) => {
    return (
        <div className='container'>
            <form onSubmit={props.loadweather}>
                <div className='row'>
                    <div className='col-md-3 offset-md-2'>
                        <input type="text" className='form-control' name='country' autoComplete='off'
                        placeholder='country'
                        ></input>
                    </div>
                    <div className='col-md-3'>
                        <input type="text" className='form-control' name='city' autoComplete='off'
                        placeholder='city'
                        ></input>
                    </div>
                    <div className='col-md-3 mt-md-0 text-md-left' >
                        <button className='btn btn-warning'>Get Weather</button>
                    </div>

                </div>
            </form>
        </div>
    )
}
function error(){
    return(
        <div className='alert alert-danger mx-5' role="alert">Please Enter Country and City</div>
    ); 
}
